import React, { Component } from 'react';

class ReachAssessment extends Component {
    constructor() {
        super();
        this.state = {
            count: 1
        }
    }

    changeCount = () => {
        this.setState(prevState => ({
            count: prevState.count + 1
        }))
    }

    render() {
        return (
            <div>
                <button>{'<'}</button>
                <span>Slide {this.state.count}</span>
                <button onClick={this.changeCount}>{'>'}</button>
            </div>
        )
    }
}

export default ReachAssessment;
